const UsersList = () => {
    return ( 
        <div className="usersList">
            <h1>users list</h1>
            <div className="book-section">
                {books.map((x)=>(
                    <div className="user-list">
                        <h1>Name:{x.name}</h1>
                        <h3>Age:{x.age}</h3>
                        <h3>Email:{x.email}</h3>
                        <h2>Ph.no:{x.phno}</h2>
                        <button onClick={()=>handleDelete(x.id,x.name)}></button>
                    </div>
                ))}
            </div>
        </div>
     );
}
 
export default UsersList;
